('Balance better and stay moving with Tai Chi & Qigong', 'D0084', 'Newstead Park, 199 Breakfast Creek Road, Newstead', 'Near the play area at the corner of Newstead Terrace.', 'Active and healthy events', 'Fitness & well-being', 'Mind and body', 'Seniors', '2022-10-21 00:30:00', '2022-10-21 01:30:00', 'Tai Chi &amp; Qigong for balance, stability and healthy ageing: Good balance requires mental and physical fitness. This proven falls-prevention program is adapted for all levels of ability and will help you feel relaxed, refreshed and calm.&nbsp;\n\nThis is a GOLD event suitable for seniors.&nbsp;', 'No requirements for this Activity', 'https://www.trumba.com/i/DgAUxiPaK2PVMUWQWZLBGhCg.jpg', 4, 0),
('Chair yoga', 'D0637', 'Wittonga Park, 98 Hilder Road, The Gap\n(dog off-leash area access via Alutha Road)', 'Meet under the trees toward the left side of the Belclare Street entrance.', 'Active and healthy events', 'Fitness & well-being', 'Mind and body', 'All ages', '2022-10-21 01:00:00', '2022-10-21 02:00:00', 'Outdoor Chair assisted yoga is prefect for those who wish to enjoy the benefits of yoga but don&#39;t want to roll around on the ground. We strengthen what we stretch and and focus on breathing well.', 'Bring a strong, stable chair with a flat seat (not camping chair)', 'https://www.trumba.com/i/DgCDJvXNZQ1o35UZdnp%2AmZIt.jpeg', 5, 0),
