('U-Jam', 'D1845', 'Rocks Riverside Park, 5 Counihan Road, Seventeen Mile Rocks', 'Under cover pavilion area to the right of the park entrance.', 'Active and healthy events', 'Fitness & well-being', 'Fitness and strength', 'Teens,Young adults,Adults (30+)', '2022-10-21 01:30:00', '2022-10-21 02:30:00', 'U-Jam fitness is the combination of urban dance with hip-hop music and fitness. It is a high energy cardio workout using the hottest beats of the moment. Feel like you\'re at a dance party every time! Suitable for all ages.', 'Bring a water bottle, sun protection, comfortable shoes and clothing and your smile', 'https://www.trumba.com/i/DgBkIPBwOuuVDKxA1TGFP5JI.jpg', 12, 0),
('Falls prevention & strength', 'D2672', 'Bulimba Riverside Park, 57 Addison Avenue, Bulimba\n(dog off-leash area access via Love Street and Addison Avenue)', 'Meet at the outdoor gym near the river.', 'Active and healthy events', 'Fitness & well-being,Free', 'Fitness and strength,Mind and body', 'Seniors', '2022-10-21 01:30:00', '2022-10-21 02:30:00', 'Bookings essential. Increase the strength throughout your entire body with our class focused on strengthening and lengthening muscles to improve posture and balance while increasing the overall stability of your body to reduce the risk of falls.\n\nThis is a GOLD event suitable for seniors.', 'Bring a yoga mat.', 'https://www.trumba.com/i/DgDVv7JvrBpK0oK-CFWICnfc.jpg', 13, 0),
('Tai chi', 'D0037', 'Hawthorne Park, 140 Riding Road, Hawthorne', 'Near the children\'s play area.', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'Seniors', '2022-10-21 01:30:00', '2022-10-21 02:30:00', 'Tai Chi for Arthritis is slow and gentle, focussing on deep breathing, maintaining good posture and circular movements. Everyone welcome.\n\nThis is a GOLD event suitable for seniors.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgBE9h7OdDhMAEFno8%2AXXXo4.jpg', 14, 0),
('Little Stars Playtime', 'D0346', 'Orleigh Park, 68 Hill End Terrace, West End', 'Meet at the playground.', 'Active and healthy events', 'Fitness & well-being', 'Kids activities', 'Preschool kids', '2022-10-21 02:00:00', '2022-10-21 04:00:00', 'Bookings essential.&nbsp; Children will have a ball in this series of interactive learn and grow sessions! Using balls, hoops, parachutes, tunnels, jumping sacks, puppets, storybooks, costumes and music, children will explore all the different ways their growing bodies can move.&nbsp; Through a range of dynamic activities, children will practive their hand eye coordination, fine motor skills and balance. These sessions are a wonderful opportunity for children and their caregivers to experience the fun of social interaction through play.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgBbsyJfeexiUgZKCc6qfX8k.jpg', 15, 0),
