('Little Stars Playtime', 'D1845', 'Rocks Riverside Park, 5 Counihan Road, Seventeen Mile Rocks', 'Meet at the grass near the wading pool.', 'Active and healthy events', 'Fitness & well-being', 'Kids activities', 'Preschool kids', '2022-10-25 02:00:00', '2022-10-25 04:00:00', 'Bookings essential.&nbsp; Children will have a ball in this series of interactive learn and grow sessions! Using balls, hoops, parachutes, tunnels, jumping sacks, puppets, storybooks, costumes and music, children will explore all the different ways their growing bodies can move.&nbsp; Through a range of dynamic activities, children will practive their hand eye coordination, fine motor skills and balance. These sessions are a wonderful opportunity for children and their caregivers to experience the fun of social interaction through play.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgBbsyJfeexiUgZKCc6qfX8k.jpg', 71, 0),
