('Aqua Zumba®', 'D0995', 'Wynnum Wading Pool Park, Wynnum Esplanade, Wynnum', 'Near the amenities block.', 'Active and healthy events', 'Fitness & well-being', 'Fitness and strength', 'All ages', '2022-10-25 09:30:00', '2022-10-25 10:30:00', 'Blend the Zumba&reg; philosophy with water resistance and you create a pool party suitable for all.&nbsp; There is less impact on your joints during an Aqua Zumba&reg; class so you can really let loose. Water creates natural resistance which means every step is more challenging and helps tone your muscles.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgCqRUIwAou68nmhxd1OwIdf.jpg', 74, 0),
