('Tai chi', 'D0037', 'Hawthorne Park, 140 Riding Road, Hawthorne', 'Near the children\'s play area.', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'Seniors', '2022-10-28 01:30:00', '2022-10-28 02:30:00', 'Tai Chi for Arthritis is slow and gentle, focussing on deep breathing, maintaining good posture and circular movements. Everyone welcome.\n\nThis is a GOLD event suitable for seniors.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgBE9h7OdDhMAEFno8%2AXXXo4.jpg', 132, 0),
