('Kids music beat groups', 'D0637', 'Wittonga Park, 98 Hilder Road, The Gap\n(dog off-leash area access via Alutha Road)', 'Meet at the basketball court.', 'Active and healthy events', 'Fitness & well-being,Free', 'Arts and creative,Kids activities', 'Preschool kids', '2022-11-04 01:30:00', '2022-11-04 02:00:00', 'Come and enjoy the great outdoors with your little ones while you move and make music together. You will share a special time with other parents, while helping your little ones learn and grow through musical play and movement. Take home tips for how to keep grooving and creating musical moments at home provided.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgDRoOlq7JO495dr9wVrXY1P.jpeg', 243, 0),
