('HIIT: 30 min cardio strength / pilates 30 min', 'D2672', 'Bulimba Riverside Park, 57 Addison Avenue, Bulimba\n(dog off-leash area access via Love Street and Addison Avenue)', 'By the picnic tables.', 'Active and healthy events', 'Fitness & well-being', 'Fitness and strength', 'All ages', '2022-11-04 22:30:00', '2022-11-04 23:30:00', 'A perfect way to do both of the fitness worlds. A boot camp style cardio and strength workout completed with a pilates component focussed on abs and core. Each workout runs for 30 minutes.&nbsp;', 'Bring a mat and/or towel.', 'https://www.trumba.com/i/DgAcO0Y-FrxWWsTG8Miinfog.jpg', 252, 0),
('Yoga by the river', 'D0075', 'Captain Burke Park, 117 Holman Street, Kangaroo Point', 'Under the big tree near the river and facilities block.', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'All ages', '2022-11-04 23:00:00', '2022-11-05 00:00:00', 'Join us for Hatha yoga classes that are suitable for everybody. Move, breath, stretch and strengthen! All levels catered for.', 'BYO yoga mat and something warm for savasana', 'https://www.trumba.com/i/DgAK95EEXIcb9yz553D%2AQ2U6.jpg', 253, 0),
('Family yoga class', 'D0723', 'Carindale Recreation Reserve, 27 Cadogan Street, Carindale', 'The picnic table near the gym equipment.', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'All ages', '2022-11-04 23:30:00', '2022-11-05 00:30:00', 'Family yoga classes are play-based active learning and are suitable for families to connect, learn and grow together. Yoga is a wonderful activity to guide you into a calm state. Using themed classes, we move our bodies in a fun way through different poses and interactive group activities.', 'Yoga mat and towel.', 'https://www.trumba.com/i/DgAbc0n6TsFO1vz%2Ag4TLMX91.jpg', 254, 0),
('Group boxing', 'D1572', 'Wakerley Park, 74  Dianthus St, Wakerley', 'On the basketball court.', 'Active and healthy events', 'Fitness & well-being', 'Fitness and strength', '10 years and over', '2022-11-05 00:00:00', '2022-11-05 01:00:00', 'Bookings essential. Our group boxing is family friendly and suitable for around 10 years to seniors. This unique COVID safe boxing is ideal for your cardio fitness, strength, coordination and will offer some great self defence tips.&nbsp;&nbsp;', 'Boxing gloves if you have them, Focus pads if you have them, towel.', 'https://www.trumba.com/i/DgDhpD4lVp2w6zG257ZUrTLd.jpg', 255, 0),
('Yoga', 'D0725', 'Wishart Community Park, 106A Kavanagh Road, Wishart', 'Maibry Street entry near the playground.', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'All ages', '2022-11-05 00:00:00', '2022-11-05 01:00:00', 'Enjoy yoga in the park. Stretching and breathing exercises relax the mind and body. Suitable for all abilities.&nbsp;', 'Bring yoga mat.', 'https://www.trumba.com/i/DgA56uf%2ATP8RSyTa0ttbe9l7.jpg', 256, 0),
('Yoga and meditation', 'D0408', 'Guyatt Park, 19 Hiron Street, St Lucia', 'By the Gazebo.', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'Teens,Young adults,Adults (30+)', '2022-11-05 00:00:00', '2022-11-05 01:00:00', 'Yoga class full of stretching, strengthening and breathing techniques combined with relaxation and meditation. No previous yoga experience required.', 'Yoga mat or thick towel', 'https://www.trumba.com/i/DgBx0Bls8RMFMthNXg0HH8Jx.jpg', 257, 0),
('Zumba fitness', 'D0463', 'Kalinga Park, 48 Kalinga Street, Kalinga\n(dog off-leash area access via Bertha Street, car park located on Bertha Street)', 'By the playground.', 'Active and healthy events', 'Fitness & well-being', 'Fitness and strength', 'All ages', '2022-11-05 00:00:00', '2022-11-05 01:00:00', 'Ditch the workout, join the party! Zumba is a dance fitness workout for EVERY BODY! Suitable for all abilities.&nbsp;', 'No requirements for this Activity', 'https://www.trumba.com/i/DgBmsZhcSloTG5wFl636VOc7.jpeg', 258, 0),
('Zumba Gold fitness', 'D0572', 'Les Atkinson Park, 430 Beenleigh Road, Sunnybank', 'Meet under blue shade cloth area, near the scout hall.', 'Active and healthy events', 'Fitness & well-being,Free', 'Fitness and strength', 'All ages', '2022-11-05 00:00:00', '2022-11-05 01:00:00', 'Get active with great people at the Zumba Gold fitness workout for the young at heart! Enjoy a fun, simple and low-impact workout in a welcoming and supportive atmosphere. Shake it at your own pace to zesty Latin tunes, spicy Indian tracks plus a variety of other wonderful music. This class will help you improve your balance, range of motion and coordination.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgAsSYik2LD8BBvCTI1qBQf8.jpg', 259, 0),
('Zumba fitness', 'D1845', 'Rocks Riverside Park, 5 Counihan Road, Seventeen Mile Rocks', 'Undercover pavilion area to the right of the park entrance.', 'Active and healthy events', 'Fitness & well-being', 'Fitness and strength', 'All ages', '2022-11-05 00:30:00', '2022-11-05 01:30:00', 'Zumba is an interval workout. The classes move between high and low intensity dance moves designed to get your heart rate up and boost cardio endurance. Join the party.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgBazK0qvLKF%2ASR3VORGk%2AVK.jpeg', 260, 0),
