('Flexibility and core training', 'D0118', 'Majestic Park, 62 Park Street, Coorparoo', 'Meet at the grass area in front of the public toilets.', 'Active and healthy events', 'Fitness & well-being', 'Fitness and strength', 'All ages', '2022-11-05 23:30:00', '2022-11-06 00:30:00', 'This class takes you through a variety of stretching and mobility exercises. Starting with a gentle warm-up you will be guided through both upper and lower body stretches and exercise to help mobilise joints and muscles. You will finish with a full body relaxation will make you feel relaxed and rejuvenated for the rest of the day.&nbsp;', 'Bring a yoga mat.', 'https://www.trumba.com/i/DgAvhicLR9Dn-WxmhVxvOtvz.jpg', 268, 0),
('Zumba fitness', 'D2072', 'Calamvale District Park, 31 Formby Street, Calamvale', 'Under the tree near the gym equipment.', 'Active and healthy events', 'Fitness & well-being', 'Fitness and strength', 'All ages', '2022-11-06 00:30:00', '2022-11-06 01:30:00', 'Start your Sunday with Zumba in the park! Upbeat music, a great workout and a fun atmosphere to start the week right. Suitable for everyone - We cater for all ages and fitness levels!&nbsp;', 'No requirements for this Activity', 'https://www.trumba.com/i/DgBazK0qvLKF%2ASR3VORGk%2AVK.jpeg', 269, 0),
('How to start beekeeping', 'D0647', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'Meet at the Kitchen in the Garden.', 'Active and healthy events', 'NULL', 'Gardening and environment', 'Preschool kids,Kids,Teens,Young adults,Adults (30+)', '2022-11-06 02:00:00', '2022-11-06 03:30:00', 'Bookings essential. Learn all you need to know at start keeping honey bees in the back yard. In this educational, inspirational and entertaining session we will share our beekeeping knowledge and how we harvest 160kg of honey from one hive in a year. A beehive is a most efficient system providing pollination, honey, pollen, royal jelly, wax and propolis.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgBAgcPPuWZI0YAOdxOTPfWI.jpg', 270, 0),
('Growing organic food in your back yard', 'D0647', 'Brisbane Botanic Gardens Mt Coot-tha, 152 Mt Coot-tha Road, Toowong', 'Meet at the Kitchen in the Garden.', 'Active and healthy events', 'NULL', 'Gardening and environment', 'Preschool kids,Kids,Teens,Young adults,Adults (30+)', '2022-11-06 03:30:00', '2022-11-06 05:00:00', 'Bookings essential. Learn how to grow enough organic food in your backyard to provide for 50-75% of your family&rsquo;s fruit and vegetable needs in a small back yard. You will also learn how to make self-watering planter boxes and plenty of practical tips about backyard gardening.', 'Bring a 2 litre plastic milk container with lid', 'https://www.trumba.com/i/DgBijf37tDWhfA6hsz5objS3.jpg', 271, 0),
('Yoga', 'D0095', 'New Farm Park, 137 Sydney Street, New Farm', 'Meet under the huge poinciana trees in the middle of the park, across from the red and beige gazebo and next to the rose garden.', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'All ages', '2022-11-06 07:00:00', '2022-11-06 08:00:00', 'Relaxing yin yoga in the park. All ages and abilities welcome. Please BYO mat.&nbsp;', 'BYO Yoga mat, optional eye-pillow or eye-mask.', 'https://www.trumba.com/i/DgDY6ekIg7fUlPlcLYqMVcYj.jpg', 272, 0),
