('Yogalates', 'D0030', 'Bulimba Memorial Park, 129 Oxford Street, Bulimba', 'Under the trees near Eton and Stuart Street.', 'Active and healthy events', 'Fitness & well-being', 'Mind and body', 'Seniors', '2022-11-08 00:15:00', '2022-11-08 01:15:00', 'Exercises with a strong pilates foundation to improve your core strength and yoga elements for improved flexibility and breathing technique. Feel refreshed by toning up in the great outdoors.\n\nThis is a GOLD event suitable for seniors.&nbsp;', 'Bring a mat and / or towel.', 'https://www.trumba.com/i/DgAvhicLR9Dn-WxmhVxvOtvz.jpg', 292, 0),
