('Hot Hula', 'D2072', 'Calamvale District Park, 31 Formby Street, Calamvale', 'Meet near amenity block', 'Active and healthy events', 'Fitness & well-being', 'Fitness and strength', 'Teens,Young adults,Adults (30+)', '2022-11-09 01:30:00', '2022-11-09 02:30:00', 'Inspired by dances of the Pacific Islands, Hot Hula fitness provides a total body workout. Core focused, easy to follow moves, suitable for all ages and fitness levels. No special equipment needed.', 'Bring a water bottle, sun protection, comfortable shoes and clothing and your smile', 'https://www.trumba.com/i/DgCxYUf4IHGq1BrTLjuG%2AWxJ.jpg', 321, 0),
('Kangatraining (mum\'s & bub\'s babywearing fitness)', 'D1763', 'Colmslie Beach Reserve, 152 Colmslie Road, Murrarie', 'On the river side grassed area on the straight section on the park road.', 'Active and healthy events', 'NULL', 'Fitness and strength', 'All ages', '2022-11-09 01:30:00', '2022-11-09 02:30:00', 'Bookings are essential. Kangatraining is a safe postnatal mum&#39;s and bub&#39;s workout. Combining core, cardio and strength based exercises while your baby is happy in a baby carrier. Suitable for all abilities.', 'Bring a yoga mat and a baby carrier (if you have one)', 'https://www.trumba.com/i/DgB54OsOs5OmGkWBH5NbM1qv.jpg', 322, 0),
('Kids music beat groups', 'D0228', '7th Brigade Park, 21 Kittyhawk Drive, Chermside\n(dog off-leash area access via Reinhold Crescent, Unmack Street or Newman Road)', 'Meet by swings near the Delaware Street carpark. This is the GEEBUNG end of the park, NOT the kidspace end.', 'Active and healthy events', 'Fitness & well-being,Free', 'Arts and creative,Kids activities', 'Preschool kids', '2022-11-09 01:30:00', '2022-11-09 02:00:00', 'Come and enjoy the great outdoors with your little ones while you move and make music together. You will share a special time with other parents, while helping your little ones learn and grow through musical play and movement. Take home tips for how to keep grooving and creating musical moments at home provided.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgDRoOlq7JO495dr9wVrXY1P.jpeg', 323, 0),
('Mums and bubs yoga', 'D0208', 'Teralba Park, 120 Pullen Road, Everton Park\n(located next to car park on Gordon Parade)', 'under the grove of trees in the centre of the park.', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'All ages', '2022-11-09 01:30:00', '2022-11-09 02:30:00', 'Bookings essential.&nbsp;Come along and join us under the trees in the park. Join our friendly group of mums practising yoga with bubs. Focused on therapeutic movement and breath and a little me time for mums to move around.', 'bring a picnic blanket, toys for bubs and a yoga mat.', 'https://www.trumba.com/i/DgB54OsOs5OmGkWBH5NbM1qv.jpg', 324, 0),
('Pilates', 'D0161', 'Dorrington Park, 5 Mirrabooka Road, Ashgrove\n(dog off-leash and car park access via Frasers Road)', 'By the playground.', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'All ages', '2022-11-09 01:30:00', '2022-11-09 02:30:00', 'Pilates strengthens and stretches simultaneously through abdominal based exercises.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgC5DXkTSDtJhPVEco3jwY-F.jpg', 325, 0),
('Yoga by the River', 'D0663', 'Booker Place Park, 89 Birkin Road, Bellbowrie\n(dog off-leash area access via Birkin Road)', 'Meet by the play equipment and river.', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'All ages', '2022-11-09 01:30:00', '2022-11-09 02:30:00', 'Enjoy yoga in the beautiful outdoors, with the birds and cool breeze. Stretching, balancing and a calm mind. Everybody welcome, mums with kids to mature.', 'Bring a yoga mat (blocks and belt if you have)', 'https://www.trumba.com/i/DgDP-7BldaFeDCsngj3A515H.jpg', 326, 0),
('Yogalates', 'D0723', 'Carindale Recreation Reserve, 27 Cadogan Street, Carindale', 'Meet near the fitness equipment near Cadogan Street.', 'Active and healthy events', 'Fitness & well-being', 'Mind and body', 'Seniors', '2022-11-09 01:30:00', '2022-11-09 02:30:00', 'Exercises with a strong pilates foundation to improve your core strength and yoga elements for improved flexibility and breathing technique. Feel refreshed by toning up in the great outdoors.\n\nThis is a GOLD event suitable for seniors.&nbsp;', 'Bring a mat and / or towel.', 'https://www.trumba.com/i/DgAvhicLR9Dn-WxmhVxvOtvz.jpg', 327, 0),
('Kids music beat groups', 'D0288', 'Moora Park, 65 Park Parade, Shorncliffe', 'Meet near the rotunda at the TOP of the park.', 'Active and healthy events', 'Fitness & well-being,Free', 'Arts and creative,Kids activities', 'Preschool kids', '2022-11-09 02:30:00', '2022-11-09 03:00:00', 'Come and enjoy the great outdoors with your little ones while you move and make music together. You will share a special time with other parents, while helping your little ones learn and grow through musical play and movement. Take home tips for how to keep grooving and creating musical moments at home provided.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgDRoOlq7JO495dr9wVrXY1P.jpeg', 328, 0),
('Strength, agility and balance for seniors', 'D0178', 'Bowman Park, 247 Simpsons Road, Bardon', 'Meet near the half basketball court.', 'Active and healthy events', 'Fitness & well-being,Free', 'Fitness and strength', 'Seniors', '2022-11-09 02:30:00', '2022-11-09 03:30:00', 'Bookings essential. Low impact body conditioning programs designed to target strength and improve overall endurance and fitness. Suitable to men and women of all fitness levels.\n\nThis is a GOLD event suitable for seniors.', 'Exercise mat, dumbbells.', 'https://www.trumba.com/i/DgALKdFlZbzAswCk-GYWOHsb.jpg', 329, 0),
('Strength and cardio', 'D1845', 'Rocks Riverside Park, 5 Counihan Road, Seventeen Mile Rocks', 'Undercover pavilion area to the right of the car park entrance.', 'Active and healthy events', 'Fitness & well-being,Free', 'Fitness and strength', 'Seniors', '2022-11-09 02:45:00', '2022-11-09 03:45:00', 'Get active with like minded people by maintaining or increasing your independence, improve brain function and boost mood with strength training. This low-impact workout is suitable for all fitness levels.\n \n This is a GOLD event suitable for seniors.', 'Bring an exercise mat.', 'https://www.trumba.com/i/DgC5HiDcdsYCveLuvw2gX0Pi.jpg', 330, 0),
('Kids music beat groups', 'D0288', 'Moora Park, 65 Park Parade, Shorncliffe', 'Meet near the rotunda at the TOP of the park.', 'Active and healthy events', 'Fitness & well-being,Free', 'Arts and creative,Kids activities', 'Preschool kids', '2022-11-09 03:00:00', '2022-11-09 03:30:00', 'Come and enjoy the great outdoors with your little ones while you move and make music together. You will share a special time with other parents, while helping your little ones learn and grow through musical play and movement. Take home tips for how to keep grooving and creating musical moments at home provided.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgDRoOlq7JO495dr9wVrXY1P.jpeg', 331, 0),
('Outdoor group fitness', 'D0148', 'Ferny Grove Picnic Ground Park, 1233 Samford Road, Ferny Grove', 'The park gym', 'Active and healthy events', 'Fitness & well-being', 'Fitness and strength', 'Seniors', '2022-11-09 07:45:00', '2022-11-09 08:45:00', 'Bookings essential. Enjoy the outdoor group fitness session before the sunset.\n\nThis is a GOLD event suitable for seniors.', 'A hat.', 'https://www.trumba.com/i/DgCaxgQXAw2ETlm054wwc5Ge.jpg', 332, 0),
('Zumba Gold Fitness', 'D0663', 'Booker Place Park, 89 Birkin Road, Bellbowrie\n(dog off-leash area access via Birkin Road)', 'Meet on the grassy area between the dog park and the playground.', 'Active and healthy events', 'Fitness & well-being,Free', 'Fitness and strength', 'All ages', '2022-11-09 09:00:00', '2022-11-09 10:00:00', 'Get active with great people at the Zumba Gold fitness workout for the young at heart! Enjoy a fun, simple and low-impact workout in a welcoming and supportive atmosphere. Shake it at your own pace to zesty Latin tunes, spicy Indian tracks plus a variety of other wonderful music. This class will help you improve your balance, range of motion and coordination.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgAsSYik2LD8BBvCTI1qBQf8.jpg', 333, 0),
('OPAcize', 'D0680', 'Kangaroo Point Cliffs Park, 29 River Terrace, Kangaroo Point', 'Mosaic Square.', 'Active and healthy events', 'Fitness & well-being,Free', 'Fitness and strength', 'All ages', '2022-11-09 09:30:00', '2022-11-09 10:30:00', 'This is a fun fitness class to Greek music. With easy to do choreography, you&#39;ll enjoy working out without realising you&#39;re exercising. Suitable for all abilities.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgARrOARoHPT9k90GhnHacKg.jpeg', 334, 0),
('Pilates', 'D0013', 'Keong Park, 38 Appleby Road, Stafford', 'In the carpark.', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'All ages', '2022-11-09 09:30:00', '2022-11-09 10:30:00', 'Pilates strengthens and stretches simultaneously through abdominal based activities.', 'Therabands.', 'https://www.trumba.com/i/DgBn-7sg-wtZpLktWji-fURD.jpg', 335, 0),
('Salsation', 'D0572', 'Les Atkinson Park, 430 Beenleigh Road, Sunnybank', 'Meet at the covered platform via Benleigh Road', 'Active and healthy events', 'Fitness & well-being', 'Fitness and strength', 'Teens,Young adults,Adults (30+)', '2022-11-09 09:30:00', '2022-11-09 10:30:00', 'Hola! Salsation is here to make you sweat to the hot beats of Latino music. Salsation is a combination of fitness meets salsa. Salsa is a popular dance originating in the Caribbean commonly used in social events. With worldwide fame, this rhythm will make you move your feet and hips while you get fit. Suitable for all ages and even those with two left feet.', 'Bring a water bottle, sun protection, comfortable shoes and clothing and your smile', 'https://www.trumba.com/i/DgBkIPBwOuuVDKxA1TGFP5JI.jpg', 336, 0),
('Fitness circuit & H.I.I.T. running', 'D0416', 'Robertson Park, 249 Indooroopilly Road, Taringa', 'At the gym equipment nearest the car park.', 'Active and healthy events', 'Fitness & well-being,Free', 'Fitness and strength', 'Young adults,Adults (30+)', '2022-11-09 22:00:00', '2022-11-09 23:00:00', 'Bookings essential. Workout set on park gym equipment including strength training and HIIT running - excellent for fast fitness and weight loss.', 'Yoga mat and grip gloves to use the gym equipment.', 'https://www.trumba.com/i/DgA21sbveGy0nMTBx7ccBfTL.jpg', 337, 0),
('Full body fusion', 'D0035', 'Colmslie Reserve, 420 Lytton Road, Morningside', 'Near the toilet block.', 'Active and healthy events', 'Fitness & well-being,Free', 'Fitness and strength', 'All ages', '2022-11-09 22:00:00', '2022-11-09 23:00:00', 'Full body fusion Is a healthy mix of strength training paired with cardio. This class is ideal for the person who wants to get the most out of their training.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgBLVqIXrDjiYr63V-kkOHDX.jpg', 338, 0),
('Pilates', 'D0438', 'Nudgee Beach Reserve, 18 Fortitude Street, Nudgee Beach', 'On the basketball court.', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'Seniors', '2022-11-09 22:30:00', '2022-11-09 23:30:00', 'Pilates strengthens and stretches simultaneously through abdominal based exercises.\n\nThis is a GOLD event suitable for seniors.', 'No requirements for this Activity', 'https://www.trumba.com/i/DgBU3KSA1QwtJQqAyhrXq-9G.jpg', 339, 0),
('Move, Stretch and Breathe', 'D0480', 'Perrin Park, 56 Josling Street, Toowong\n(dog off-leash area access via Heroes Ave, located at rear of car park and bowls club)', 'Near Basketball court', 'Active and healthy events', 'Fitness & well-being,Free', 'Mind and body', 'Seniors', '2022-11-10 00:00:00', '2022-11-10 01:00:00', 'Gentle blend of movement, yoga and breathing techniques to increase your cardio, flexibility, strength and balance. All levels catered for. \n\nThis is a GOLD event suitable for seniors.', 'Yoga mat and sport shoes.', 'https://www.trumba.com/i/DgAbOXoVvkt9X8UE-uhhKUC7.jpg', 340, 0);
INSERT INTO `comment` (`sender`, `comment_time`, `words`, `post_id`) VALUES
('Jacob', '2022-10-21 02:52:35', 'I agree. I enjoyed being here last time', 1),
('Zoey', '2022-10-21 02:59:47', 'It is not usually crowded and people sometimes hang out in small groups or walk their dog.', 1),
('Cosette', '2022-10-21 03:08:37', 'Thanks for your sharing. I\'m going to visit the park next week', 1),
('jack', '2022-10-21 02:54:06', 'Can i join with you in next time?', 2),
('Ben', '2022-10-21 02:54:49', 'I sweated a lot during the basketball game today', 2),
('Nolan', '2022-10-21 02:55:17', 'The beautiful grassed long walking area is directly on the river', 3),
('Scott', '2022-10-21 03:00:30', 'Plenty of seating, BBQ and upgraded outdoor gym. Handy ammenities. Great for kids party.', 4),
('Eric', '2022-10-21 03:02:49', 'Nice open and clean area, pop on by every Saturday for the west end Markets and you\'ll fall in love. Great place to sit down and eat or play games', 4),
('Lowie', '2022-10-21 03:01:04', 'Due to the popularity of the park there is large crowds and lack of parking. Therefore you need to arrive early to book the best locations.', 5),
('BEN', '2022-10-21 02:56:24', 'One of the best parks in Brisbane. Gets very busy, but worth it. ', 6),
('Sarah', '2022-10-21 02:58:21', 'Plenty of seating, BBQ and upgraded outdoor gym. Handy ammenities. Great for kids party.', 7),
('Avishai', '2022-10-21 03:03:45', 'Great place for a picnic, watch the sunset and to be transported into wonderland when the tree lights come on', 7),
('Anonymous14', '2022-10-21 14:31:08', 'Cum on!!', 7),
('Sam', '2022-10-21 03:01:35', 'This park is good for pause a break if your jogging,walking or whatever..Highlight of this park is the Jacob\'s ladder.', 8),
('Anonymous5', '2022-10-21 14:35:29', 'Unbelievable!! Cum meet me next time.', 8),
('Thekla', '2022-10-21 02:58:48', 'It is generally very quiet as the speed limit for cars nearby is low 50 kph.', 9),
('Glick', '2022-10-21 03:07:29', 'A beautiful day for a stroll through the park and along the waterfront. There is plenty of space for kids to run around or play games.', 10),
('Anonymous11', '2022-10-22 15:11:20', 'Love ya, my pre!', 12);
