INSERT INTO `post` (`sender`, `post_time`, `post_img`, `title`, `words`, `likes`, `is_activity`, `post_id`) VALUES
('Jamse', '2022-10-20 12:08:23', 'https://images.pexels.com/photos/1645840/pexels-photo-1645840.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1', 'Happy evening', 'Walking in the park with my dog. A beautiful day for a stroll through the park and along the waterfront. There is plenty of space for kids to run around or play games. ', 3, 0, 1),
('Wolfy Glick', '2022-10-20 13:56:37', 'https://images.pexels.com/photos/2169302/pexels-photo-2169302.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1', 'Hearty basketball game!', 'Thanks to everyone who participated in today\'s game, and we\'ll see you in the next game, which will be held next Tuesday.', 0, 1, 2),
('Zoeeey', '2022-10-21 02:21:16', NULL, 'First time to visit this park', 'This is a forest park. Very quiet, shady trees, but today the wind is too strong, very cold, so only walked for a while and then withdrew. It should be nice in summer.', 6, 0, 3),
('Adams', '2022-10-21 02:33:41', 'https://images.pexels.com/photos/9989678/pexels-photo-9989678.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1', 'Walking in KEONG PARK', 'Great park, not too overwhelming for littles but has plenty of choices. Playground area is fully fenced. Lots of shaded areas to sit and has a nice scooter path.', 9, 0, 4),
('Sarah', '2022-10-21 02:40:09', NULL, 'Let us go Keong Park with children', 'A lovely community based facility, plenty of off and on street parking, clean and bright, have a well equipped playground.', 2, 0, 5),
('Matra', '2022-10-21 02:40:09', 'https://images.pexels.com/photos/5875867/pexels-photo-5875867.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1', 'Go to West End Riverside Lands Park! This is the perfect place to visit!', 'West End Riverside Lands Park is a \"free\" tonic for the heart and the soul. You can walk it, bike it, row it or jog it, take the dog, the canoe, the kids, or your latest squeeze. Park bench it and check out the rowers whilst admiring the views across the river to Toowong. Hammer it on the work out station and get your heart rate pumping, or be at one with nature and your yoga mat, alongside the relaxing river\'s edge.', 8, 0, 6),
('Zhizhang', '2022-10-21 02:44:51', 'https://images.unsplash.com/photo-1624880357913-a8539238245b?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80', 'Come here to play', 'Dittmer Park has a decent range of football fields - including soccer and AFL fields - that are well kept and presented. The clubhouse and canteen are beginning to show their age and are not the cleanliest things around. The service by the staff is pretty good, nothing amazing though. Not a bad place to play or watch football.', 7, 0, 7),
('Maksim', '2022-10-21 02:45:43', 'https://images.pexels.com/photos/8640805/pexels-photo-8640805.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1', 'Great place with beautiful gardens', 'You could spend the whole day here with several activities and attractions. A man-made lagoon at the centre of the city for swimming is quite unique. I would recommend going for swimming in the early mornings before it gets busy.', 2, 0, 8),
('Joppe', '2022-10-21 02:48:04', NULL, 'Children\'s Park', 'Great park, not too overwhelming for littles but has plenty of choices. Playground area is fully fenced. Lots of shaded areas to sit and has a nice scooter path. Would rate 5 stars if there was a public toilet!', 5, 0, 9),
('Alex', '2022-10-21 03:06:58', 'https://images.unsplash.com/photo-1561283890-5d858c23b2ea?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1676&q=80', 'Beautiful park', 'A great little park with very new swings in quite a hidden location. Surrounded by trees so many may not even k ow it is there. Slides and equipment for all ages from toddlers up.', 3, 0, 10),
('Donald Trump', '2022-10-21 15:04:05', NULL, 'My FIrst Post', 'I, the forever POTUS, am now sending this post to test the functionality.', 0, 1, 12);
